import React, { Component } from 'react';


class Prazo extends Component {
    render = () => {
        return(
            <div className={"deadline-container"}>
                <p className={"deadline-title"}>
                    Prazo
                </p>
                <div className={"deadline-label"}>
                    <p>10/20</p>
                </div>
                <p className={"deadline-info"}>
                    Faltam x dias
                </p>
            </div>
        );
    }
}

export default Prazo;
